utilmodule.byteArrayToBlobHexString = function(buffer) {
  var array, i, len, num, resultString;
  array = new Uint8Array(buffer);
  resultString = "x'";
  for (i = 0, len = array.length; i < len; i++) {
    num = array[i];
    if (num < 16) {
      resultString += "0";
    }
    resultString += num.toString(16);
  }
  resultString += "'";
  utilmodule_log(resultString);
  return resultString;
};

utilmodule.mapIdToProgram = function(allPrograms) {
  var i, j, len, len1, program, ref, ref1, result;
  result = [];
  ref = allPrograms.relaxprograms;
  for (i = 0, len = ref.length; i < len; i++) {
    program = ref[i];
    result[program.id] = program;
  }
  ref1 = allPrograms.performprograms;
  for (j = 0, len1 = ref1.length; j < len1; j++) {
    program = ref1[j];
    result[program.id] = program;
  }
  return result;
};

